import React from 'react';
import Navbar from './navBar';
import Header from './Header';
import HowItWorks from './HowWorks';
import Aboutus from './Aboutus';
import Services from './Services'
import Contact from './Contact'

const App = () => {
  return (
    <>
      <Navbar />
      <Header />
      <HowItWorks />
      <Aboutus />
      <Services />
      <Contact />
      <Footer />
    </>
  )
}

export default App
